package br.gov.caixa.siacc.vo;

public class TipoPessoa {

	public TipoPessoa() {
		// TODO Auto-generated constructor stub
	}
	private String  noTipoPessoa;
	private String idTipoPessoa;
	private Boolean icSelecionado;
	private String siglaTipoPessoa;
	private String nuCpfCnpj;
	private String nuCpfCnpjBasico;
	private String nuCpfCnpjOrden;
	private String nuCpfCnpjDv;
		 
	public String getNoTipoPessoa() {
		return noTipoPessoa;
	}
	public void setNoTipoPessoa(String noTipoPessoa) {
		this.noTipoPessoa = noTipoPessoa;
	}
	public String getIdTipoPessoa() {
		return idTipoPessoa;
	}
	public void setIdTipoPessoa(String idTipoPessoa) {
		this.idTipoPessoa = idTipoPessoa;
	}
	public Boolean getIcSelecionado() {
		return icSelecionado;
	}
	public void setIcSelecionado(Boolean icSelecionado) {
		this.icSelecionado = icSelecionado;
	}
	public String getSiglaTipoPessoa() {
		return siglaTipoPessoa;
	}
	public void setSiglaTipoPessoa(String siglaTipoPessoa) {
		this.siglaTipoPessoa = siglaTipoPessoa;
	}
	public String getNuCpfCnpj() {
		return nuCpfCnpj;
	}
	public void setNuCpfCnpj(String nuCpfCnpj) {
		this.nuCpfCnpj = nuCpfCnpj;
	}
	public String getNuCpfCnpjBasico() {
		return nuCpfCnpjBasico;
	}
	public void setNuCpfCnpjBasico(String nuCpfCnpjBasico) {
		this.nuCpfCnpjBasico = nuCpfCnpjBasico;
	}
	public String getNuCpfCnpjOrden() {
		return nuCpfCnpjOrden;
	}
	public void setNuCpfCnpjOrden(String nuCpfCnpjOrden) {
		this.nuCpfCnpjOrden = nuCpfCnpjOrden;
	}
	public String getNuCpfCnpjDv() {
		return nuCpfCnpjDv;
	}
	public void setNuCpfCnpjDv(String nuCpfCnpjDv) {
		this.nuCpfCnpjDv = nuCpfCnpjDv;
	}

}
